import {useRef} from "react"
//import {FaBars, FaTimes} from "react-icons/fa"
import "./Styles/main.css"
function NavBar() {
    const navRef = useRef();
    return (
        <header>
            <div className="HeaderClass">
                    
                <nav ref={navRef}>
                    <h2 href="/#">NGUYEN MINH NHAT </h2>    
                   <a href="/#">Projects</a>
                   <a href="/#">Cats</a>
                </nav>
            </div>
            
            
        </header>
    );
}

export default NavBar;
